--------------------------------------------------------
--  DDL for Function CALCULAR_SALARIO
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE FUNCTION "NOBERTO"."CALCULAR_SALARIO" (
    p_pessoa_id IN INTEGER
)
RETURN salarios
AS
    sal salarios := salarios();
    v_salario_bruto NUMBER;
    v_descontos NUMBER;
    v_salario_liquido NUMBER;
BEGIN
    -- Cálculo do salário bruto
    SELECT SUM(CASE
                   WHEN v.tipo = 'C' AND v.forma_incidencia='V' THEN v.valor -- Crédito direto
                   WHEN v.tipo = 'C' AND v.forma_incidencia='P' THEN (v.valor / 100) * (
                       SELECT SUM(CASE
                                      WHEN v2.tipo = 'C' THEN v2.valor -- Crédito direto
                                      ELSE 0
                                  END)
                       FROM cargo c2
                       JOIN cargo_vencimentos cv2 ON cv2.cargo_id = c2.id
                       JOIN vencimentos v2 ON v2.id = cv2.vencimento_id
                       WHERE c2.id = (SELECT cargo_id FROM pessoa WHERE id = p_pessoa_id)
                           AND v2.tipo = 'C' and v2.forma_incidencia='V' -- Apenas créditos com forma de incidencia de valor
                   )
                   ELSE 
                   0
               END) -- Soma dos créditos que podem ter a forma de incidencia como percentual
    INTO v_salario_bruto
    FROM cargo c
    JOIN cargo_vencimentos cv ON cv.cargo_id = c.id
    JOIN vencimentos v ON v.id = cv.vencimento_id
    WHERE c.id = (SELECT cargo_id FROM pessoa WHERE id = p_pessoa_id);

    -- Cálculos dos descontos
    SELECT SUM(CASE WHEN v.tipo = 'D' AND v.forma_incidencia='V' THEN v.valor 
                    WHEN v.tipo = 'D' AND v.forma_incidencia='P' THEN (v.valor / 100) * v_salario_bruto
            ELSE
            0
    END)
    INTO v_descontos
    FROM cargo c
    JOIN cargo_vencimentos cv ON cv.cargo_id = c.id
    JOIN vencimentos v ON v.id = cv.vencimento_id
    WHERE c.id = (SELECT cargo_id FROM pessoa WHERE id = p_pessoa_id);

    -- Cálculo do salário líquido
    v_salario_liquido := v_salario_bruto - v_descontos;
    
    --Preenchendo a variavel de retorno do salario
    sal.extend;
    sal(1) := salario_pessoa(v_salario_bruto, v_descontos,v_salario_liquido);
    
    RETURN sal;
END;

